                <label>{this.props.obj.name}</label><br />
                <span className="tag">{this.props.obj.owner}</span>
                <br/>
                <em>priority</em>
                <br />
                <label style={{display : 'inline-block' ,  verticalAlign : 'middle'}}>
                    <span className="icon is-left "><i className="fa fa-calendar"></i> </span> 09-05-1998
                </label>
            </div>
        )
    }
}
